import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'
import Home from './pages';

function App() {
  return (
    <Router>
      <Routes>
        <Route path='/Home' component={<Home/>} exact />
      </Routes>

    </Router>
  );
}

export default App;
